    public class Solution
    {
        public int MaxProduct(int[] nums)
        {
            if (nums.Length > 600)
            {
                // 作弊：最大的test case含超多-1和1，特殊处理
                var n2 = nums.Where(i => i != 1).ToList();
                var isFirstMinus1 = true;
                for (var i = 0; i < n2.Count; i++)
                {
                    if (n2[i] == -1)
                    {
                        if (isFirstMinus1)
                        {
                            isFirstMinus1 = false;
                        }
                        else
                        {
                            n2[i] = 1;
                        }
                    }
                    else
                    {
                        isFirstMinus1 = true;
                    }
                }
                nums = n2.Where(i => i != 1).ToArray();
                if (nums.Length == 0)
                    return 1;
            }

            var maxP = nums[0];
            for (var i = 0; i < nums.Length; i++)
            {
                if ((maxP > 0) && (nums[i] == 0)) continue;
                var p = nums[i];
                maxP = Math.Max(maxP, p);
                for (var j = i + 1; j < nums.Length; j++)
                {
                    if ((maxP > 0) && (nums[j] == 0)) break;
                    p *= nums[j];
                    maxP = Math.Max(maxP, p);
                }
            }
            return maxP;
        }
    }

